import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <>
      <Routes>
        <Route path='/' element={<Home/>}></Route>
        <Route path='about' element={<Home/>}></Route>
      </Routes>
    </>
  )
}

export default App
